const { Configuration, OpenAIApi } = require("openai");

const configuration = new Configuration({
  apiKey: process.env.OPENAI_API_KEY,
});
const openai = new OpenAIApi(configuration);

const Timecomplexity = async () => {
  try {
    const response = await openai.createCompletion({
      model: "text-davinci-003",
      prompt:
        "def foo(n, k):\n  accum = 0\n  for i in range(n):\n    for l in range(k):\n      accum += i\n  return accum\n\n\"\"\"\nThe time complexity of this function is",
      temperature: 0,
      max_tokens: 64,
      top_p: 1.0,
      frequency_penalty: 0.0,
      presence_penalty: 0.0,
      stop: ["\n"],
    });

    if (response.data && response.data.choices[0].text) {
      const timeComplexity = response.data.choices[0].text.trim();
      console.log("Time Complexity:", timeComplexity);
    }
  } catch (error) {
    console.error("Error:", error);
  }
};

export default Timecomplexity;
